import './AboutUs.css' ;
import logoTitle from '../Photos/logoTitle.png';
const AboutUs = () =>{

    return(
        <>
        
            <div >
              
                <h1 className="title"> <img src={logoTitle} alt='logo' className="logo"></img>About Us</h1>
            </div>
        </>
    );
} ;

export default AboutUs ;
